import React from "react";

import { Button, Pane, Table } from "evergreen-ui";

import DeleteButton from "../UI/DeleteButton";
// import Movie from "./Movie/Movie";

import classes from "./Movie/Movie.module.css";

const MovieList = (props) => {

  return (
    <Pane paddingTop={50}>
      <Table>
        <Table.Head>
          <Table.TextHeaderCell>Watched</Table.TextHeaderCell>
          <Table.TextHeaderCell>Title</Table.TextHeaderCell>
          <Table.TextHeaderCell>Genres</Table.TextHeaderCell>
          <Table.TextHeaderCell>Overview</Table.TextHeaderCell>
          <Table.TextHeaderCell>Rating</Table.TextHeaderCell>
          <Table.TextHeaderCell>Poster</Table.TextHeaderCell>
          <Table.TextHeaderCell>Del</Table.TextHeaderCell>
        </Table.Head>
        <Table.Body height={600}>
          {props.movies.map((movie) => {
            return (
              <Table.Row key={movie._id}>
                <Table.TextCell className={classes.watched}>
                  {movie.watched ? "V" : "O"}
                </Table.TextCell>
                <Table.TextCell>{movie.title}</Table.TextCell>
                <Table.TextCell>{movie.genres}</Table.TextCell>
                <Table.TextCell>{movie.overview}</Table.TextCell>
                <Table.TextCell>{movie.voteaverage}</Table.TextCell>
                <Table.Cell className={classes.poster}>
                  <img
                    className={classes.poster}
                    src={`https://image.tmdb.org/t/p/original${movie.posterpath}`}
                    alt="poster"
                  />
                </Table.Cell>
                <Table.Cell className={classes["delete-button"]}>
                  <DeleteButton movie={movie} />
                </Table.Cell>
              </Table.Row>
            );

            // return <Movie key={movie._id} movie={movie} />;
          })}
        </Table.Body>
      </Table>

      <Button
        height={50}
        marginRight={16}
        appearance="primary"
        intent="danger"
        onClick={props.logOut}
      >
        Log Out
      </Button>
    </Pane>
  );
};

export default MovieList;
